import './App.css';
import React, {Component} from 'react';
import {Routes,Route,Link,BrowserRouter, HashRouter} from "react-router-dom";
import Feed from './Feed';
import Login from "./login";
import Register from "./register";
import Profile from "./profile";


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="high-five.png" className="App-logo" alt="logo" />
       <p>Hi! Hier entsteht die Gimme 5 App.</p>
       <p>Â©2023 by Kathrin + Thomas ðŸ˜œ</p>
       <HashRouter>
       <ul className="header">
             <li><NavLink to="/">Feed</NavLink></li>
            <li><NavLink to="/login">Login</NavLink></li>
            <li><NavLink to="/register">Register</NavLink></li>
            <li><NavLink to="/profile">Profile</NavLink></li>
          </ul>
          <div className="content">
            <Route path="/" component={Feed}/>
            <Route path="/stuff" component={Login}/>
            <Route path="/register" component={Register}/>

          </div>
          </HashRouter> 
      </header>
    </div>
  );
}

export default App;
